import React from 'react';

export class Table extends React.Component {
    render() {
        return (
            <table  className='contacts-table'>
                <caption>Список контактов</caption>
                <tr>
                    <td></td>
                    <td></td>
                    <td></td>
                </tr>
                <tr>
                    <td>Имя</td>
                    <td>Фамилия</td>
                    <td>Телефон</td>
                </tr>
                <tr>
                    <td>Вася</td>
                    <td>Пупкин</td>
                    <td>88005553535</td>
                </tr>
            </table>
        );
    }
}
